  [],\n\t\"num_tags\": 0,\n\t\"name\": \"afsc-race-sap-long-data-on-the-effects-of-release-density-on-release-success-in-hatchery-reared\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data is from an experiment designed
  to test the viability of using hatchery reared crab to supplement wild stocks and
  to determine the optimal density for future releases.  Crab were released by divers
  into 5 x 5 m quadrats marked with ground line at three densities: 25, 50, and 75
  m-2.  Researchers monitored the crab density inside the plots, in order to estimate
  survival, as well as outside the plots, to estimate crab movement.  In addition,
  they determined predator densities and performed tethering experiments on red king
  crab to see if predator density or predation risk differed among the density treatments.\",\n\t\"owner_org\":
